	def test_if_nodes_are_correct(self):
		self.assertEqual(self.nodes,self.find_nodes())

	def test_if_is_p_vertex(self):
		for i in self.nodes:
			self.assertTrue(self.is_p_vertex(i))
	
	def test_make_all_paths_work(self):
		g = MakeGraph()
		paths = g.make_all_paths
		self.assertNotEqual(paths,{})

	def test_are_correct_shortest_paths(self):
		g = MakeGraph()
		paths = g.make_all_paths
		self.assertNotEqual(paths,self.shortest_paths)

	def test_bfs_function_works_correctly(self):
		g = MakeGraph()
		for i in self.nodes:
			path = g.bfs(i)
			self.assertEqual(self.shortest_paths[i],path)

